import { Form, Box } from 'react-bulma-components';

function Search() {

    const { Input, Field, Control, Label } = Form;
  return (
    <div>
        <Box>
        <Field>
            <Label>Genres</Label>
            <Control>
                <Input type='text' placeholder='ambient, thrash metal, etc.'/>
            </Control>
        </Field>
        </Box>
    </div>
  )
}

export default Search
